$outputfile = Join-Path $metalog_location -ChildPath "step1_download_"
$targetPath_pmm_bw = Join-Path -Path $script_path -ChildPath "bw"
$targetPath_rainier = Join-Path -Path $script_path -ChildPath "rainier"
